import React from "react";
import ReactDOM from "react-dom";

var count = 0;

function add() {
  count++;
  console.log(count);
}
ReactDOM.render(
  <div className="container">
    <h1>{count}</h1>
    <button onClick={add()}>+</button>
  </div>,
  document.getElementById("root")
);
